import {useSelector} from "react-redux"
import React, {useEffect, useState} from "react";
import {Link} from "react-router-dom";
import {findUserByID} from "../services/users-services";
import {findSalesByBookID, findSalesByUserID, createSale} from "../services/sales-services";

const SalesComponentItem = ({sale}) => {
    console.log(sale);

    return(
        <tr>
            <th scope="row">{sale.uid}</th>
            <td>{sale.bid}</td>
            <td>{sale.quantity}</td>
            <td>{sale.price}</td>
            <td></td>
        </tr>
    )
}

export default SalesComponentItem;
